{"source":{"uri":"Features/specs/home.feature","data":"#language: pt\n\n#Plano de Teste\nFuncionalidade: Home Page\n\nCenario: Acessar home page\n\nDado que eu acesse a home page do projeto Qa.Coders\nEntão devo visualizar a informação \"Aprenda na prática.\"\n\n#2° Cenário - Sobre nós\nCenario: Acessar Sobre Nós\n\nDado que estou na home page do projeto Qa.Coders\nQuando clico no menu \"Sobre nós\"\nEntão devo enxergar o texto \"Sobre nós\"\n\n#3° Cenário - Depoimentos\nCenario: Acessar Depoimentos\n\nDado que estou acessando a home page do projeto Qa.Coders\nQuando clico em \"Depoimentos\"\nEntão devo ler a informação \"O Qa.Coders é feito para os alunos\"\n\n#4° Cenário - Parceiros\nCenario: Parceiros\n\nDado que estou com acesso à home page do projeto Qa.Coders\nQuando clico para ver \"Parceiros\"\nEntão devo verificar listagem de \"Parceiros\"\n\n#5° Cenário - Fale Conosco\nCenario: Fale Conosco\n\nDado que me encontro na home page do projeto Qa.Coders\nQuando clico no \"Fale Conosco\"\nEntão devo obter informações de \"Fale Conosco\"\n\n\n\n\n\n","mediaType":"text/x.cucumber.gherkin+plain"}},
